import React from "react";
import styled from "styled-components";

interface NaviIconProps {
  mode: "Default" | "Unclicked" | "Clicked";
  icon: string;
  label: string;
  onClick?: () => void;
}

const NaviIcon: React.FC<NaviIconProps> = ({ mode, icon, label, onClick }) => {
  return (
    <IconWrapper mode={mode} onClick={onClick}>
      <IconImage src={icon} alt={label} />
      <Label>{label}</Label>
    </IconWrapper>
  );
};

export default NaviIcon;

// Styled Components
const IconWrapper = styled.div<{ mode: "Default" | "Unclicked" | "Clicked" }>`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 168px;
  height: 220px;
  border-radius: 32px;
  padding: 20px;
  gap: 10px;
  cursor: pointer;

  background-color: ${({ mode, theme }) =>
    mode === "Default"
      ? theme.colors.purple[100]
      : mode === "Unclicked"
      ? theme.colors.gray[400]
      : theme.colors.purple[100]};
  box-shadow: ${({ mode }) =>
    mode === "Clicked"
      ? "inset 0px 4px 4px 8px rgba(0, 0, 0, 0.5)"
      : "0px 4px 4px 8px rgba(0, 0, 0, 0.5)"};
`;

const IconImage = styled.img`
  width: 128px;
  height: 128px;
`;

const Label = styled.div`
  font-size: ${({ theme }) => theme.typography.T4.size};
  font-weight: ${({ theme }) => theme.typography.T4.weight};
  line-height: ${({ theme }) => theme.typography.T4.lineHeight};
  text-align: center;
  color: ${({ theme }) => theme.colors.black};
`;
